INSERT INTO `reptile_data` VALUES (1794213805530640386, 5, '{\"newsTime\":\"11:38\",\"content\":\"【内蒙古林西县一矿业公司治理塌陷区时发生塌陷 4人下落不明】 从内蒙古自治区赤峰市应急管理、消防救援等部门获悉，24日19时45分，赤峰市林西县金源矿业开发有限公司治理塌陷区进行充填作业时地表发生塌陷，4人坠入塌陷坑，下落不明。\"}', 2138722497, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213805555806210, 5, '{\"newsTime\":\"11:28\",\"content\":\"【广东东莞：严查将商办类项目变相改造为具备居住功能的 “类住宅”】 广东省东莞市住房和城乡建设局等五部门联合印发《关于进一步优化房地产相关政策的通知》。文件要求，严格查处将商办类项目变相改造为具备居住功能的“类住宅”建筑的行为，扎实推进“两违”治理工作，坚决遏制、打击“小产权房”。打好商品住房项目保交房攻坚战，防范处置烂尾风险。完善房屋从开发建设到维护使用的全生命周期管理机制，探索建立房屋体检、房屋养老金、房屋保险等专项制度。切实保障购房人合法权益，营造公平竞争、良性发展的房地产市场环境。\"}', 472556161, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213805564194817, 5, '{\"newsTime\":\"11:26\",\"content\":\"【OpenHarmony开源三年 已有7500多名社区共建者】 5月25日上午，OpenHarmony（开源鸿蒙）开发者大会2024上，OpenHarmony项目群工作委员会执行主席、华为终端BG软件部副总裁柳晓见表示，OpenHarmony开源三年来，OpenHarmony版本持续演进，版本能力快速迭代，截至目前已有7500多名社区共建者、70家共建单位、1.1亿+行代码量、近600款软硬件产品。\"}', -349765007, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213805606137858, 5, '{\"newsTime\":\"11:19\",\"content\":\"【佳禾智能：将建设及运维子公司江西佳禾生产基地屋顶光伏项目 下一步会拓展工商业光伏储能电站等相关新能源项目】 佳禾智能5月25日在互动平台表示，公司于2024年3月设立了佳禾新能源（江西）有限公司，首先将建设及运维子公司江西佳禾生产基地屋顶光伏项目，下一步将会拓展工商业光伏储能电站等相关新能源项目，进一步扩大业务范围和板块，提升公司可持续发展能力和综合竞争力。\"}', -1107454357, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213805622915073, 5, '{\"newsTime\":\"10:55\",\"content\":\"【日本财务省副大臣神田真人：将采取适当措施应对汇率过度波动】 日本负责外汇事务的财务省副大臣神田真人重申其采取适当措施应对汇率过度波动的立场。神田真人表示，过度、无序的外汇波动对经济有害。较少的干预是理想的，但如果出现过度波动，当局就必须采取行动。\"}', 2145195315, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213805656469506, 5, '{\"newsTime\":\"10:55\",\"content\":\"【KKR对意大利电信的220亿欧元收购交易据悉接近获得欧盟批准】 美国私募股权公司KKR对意大利电信的220亿欧元收购交易据悉即将获得欧盟批准。知情人士称，该交易有望在下周获批，在这一过程中，KKR提出了一个非正式要约，即以当前价格维持与意大利电信竞争对手的约15个现有暗光纤批发合同。\"}', 1808343046, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213805673246722, 5, '{\"newsTime\":\"10:45\",\"content\":\"【中国电信董事长柯瑞文：持续攻关通用大模型和量子计算云平台，加快6G网络架构与标准研究】 5月24日，第七届数字中国建设峰会在福州举行，中国电信董事长柯瑞文在开幕式上表示，科技创新是发展新质生产力的核心要素，中国电信持续加大科技创新力度，在云和云网融合领域，突破了云操作系统等“卡脖子”技术，云底座平台摆脱开源限制，打造通智超一体化智算加速平台“云骁”、一站式智算服务平台“慧聚”、算力调度平台“息壤”。柯瑞文称，这三个平台是全国一体化算力体系的核心平台，这三大平台的建设标志着天翼云作为国家云已经越过向智能云发展的拐点。下阶段，中国电信将重点攻关异构云调度、智算网络、云网操作系统等卡点技术，为算力资源高质量供给持续贡献创新方案。在人工智能、量子、网络领域，持续攻关通用大模型和量子计算云平台，加快6G网络架构与标准研究，积极抢占科技竞争和未来发展制高点。\"}', 1161713322, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213805690023937, 5, '{\"newsTime\":\"10:45\",\"content\":\"【全国市场监管系统技术性贸易措施工作推进会在杭州召开】 全国市场监管系统技术性贸易措施工作推进会在浙江省杭州市召开。会议强调，各级市场监管部门要深刻认识技贸措施工作在构建新发展格局中的重要作用。要加强调查研究、预警评议、汇报宣传，积极打造技贸“工具箱”，发挥技贸措施促进产业发展正向作用。要加强系统内外专家队伍建设，加快技贸措施工作数字化发展，提升主动设置议题能力。要加强工作网络建设，构建工作推进模式，搭建信息交流平台，进一步强化国际合作。\"}', -707496152, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213805748744194, 5, '{\"newsTime\":\"10:31\",\"content\":\"【中建西部建设西南公司郫县厂签约成都市京东方第8.6代AMOLED生产线项目】 近日，中建西部建设西南有限公司郫县厂（简称“郫县厂”）成功签约京东方第8.6代AMOLED生产线项目（A标段和B标段），项目整体需求混凝土量约120万方，郫县厂签约混凝土31.5万方。\"}', -1660062554, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213805841018881, 5, '{\"newsTime\":\"10:18\",\"content\":\"【万亿公募迎新老总 降薪降费下 如何保持增速正待破题】 5月25日，博时基金发布公告，自2024年5月24日起，张东正式就任博时基金总经理，博时基金董事长江向阳不再兼任总经理。年内基金行业内已有145位高管变更，15家基金管理人的总经理一职发生变动。\"}', 482196684, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213805887156225, 5, '{\"newsTime\":\"10:17\",\"content\":\"【美防长奥斯汀完成膀胱问题相关治疗 恢复履职】 据央视新闻，美国防长奥斯汀在美东时间24日晚8时25分恢复履职。当地时间5月24日，美国国防部发表声明称，美国国防部长奥斯汀此前于24日晚6时左右在沃尔特·里德国家军事医学中心接受膀胱问题有关的微创非手术后续治疗，相关治疗在持续2.5小时后完成。美国防长奥斯汀在美东时间24日晚8时25分恢复履职。\"}', 52248310, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213805903933441, 5, '{\"newsTime\":\"10:13\",\"content\":\"【吉林省调整住房贷款政策 首套房首付不低于15%】 人民银行吉林省分行就“优化吉林省各城市首套住房、二套住房最低首付比例”以及“取消吉林省各城市首套住房和二套住房商业性个人住房贷款利率政策下限”等事项形成决议：5月24日起，取消吉林省各城市首套住房和二套住房商业性个人住房贷款利率政策下限；全面优化住房信贷政策，吉林省各城市首套住房商业性个人住房贷款最低首付款比例调整为不低于15%，二套住房商业性个人住房贷款最低首付款比例调整为不低于25%。\"}', -2134462792, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213805958459394, 5, '{\"newsTime\":\"10:12\",\"content\":\"【中国能建山西电建总承包建设的澳大利亚储能EPC项目正式开工】 5月24日，中国能建山西电建总承包建设的澳大利亚南澳洲Templers储能离岸EPC项目正式开工，该项目是中国能建在澳大利亚市场首个储能项目。澳大利亚自然资源丰富，市场机制完善，发展前景广阔。中澳双方在战略、供需和产业链互补上具有广阔的合作空间。中国能建在澳加大清洁能源和储能等重点领域布局，先后与当地能源开发商ZEN Energy公司、Genaspi Group签署了系列光储合作项目。\"}', 864326471, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213805983625217, 5, '{\"newsTime\":\"10:09\",\"content\":\"【备足“弹药”以防意外！美股T+1结算时代下周开启 华尔街担心会出事】 在结束阵亡将纪念的周末小长假后，美股的“T+1结算时代”即将于下周二正式开启；然而，在这一划时代的结算机制变革到来之前，不少华尔街机构却颇有些“心神不宁”。\"}', 104266093, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806033956865, 5, '{\"newsTime\":\"10:05\",\"content\":\"【北京明天分配58400个家庭新能源小客车指标】 明天，北京将分配今年58400个家庭新能源小客车指标，备受关注的新能源指标入围“分数线”也将揭晓。今天上午，北京市小客车指标调控管理办公室发布今年新能源小客车指标申请数据，本期共有30.6万个家庭申请新能源指标。\"}', 110755566, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806075899906, 5, '{\"newsTime\":\"09:52\",\"content\":\"【英伟达“概念基”领涨市场！】 受此带动，国内多只重仓英伟达的主动型QDII取得了显著的收益回报。数据显示，截至5月23日，建信新兴市场混合（QDII）A成为今年以来业绩排名第一的QDII产品，收益率达到了25.63%，基金净值创下年内新高。\"}', 936555489, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806101065729, 5, '{\"newsTime\":\"09:44\",\"content\":\"【墨西哥东南部发生4.1级地震】 根据墨西哥国家地震监测局的信息，24日11时41分13秒，在墨西哥东南部的瓦哈卡州的克鲁塞西塔市东南方向约66公里处发生4.1级地震，震源深度约7.2公里。墨西哥的地震预警系统没有启动，目前暂无人员伤亡和财产损失的报告。\"}', 906359405, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806117842945, 5, '{\"newsTime\":\"09:43\",\"content\":\"【大模型价格战“卷”向何方？】 大厂告别“烧钱出奇迹”思维，将基础模型做强做实，尽快缩小与国外技术差距；创业公司向垂直纵深探索，做“精”做“尖”大模型行业应用，或许才是国内大模型生态可持续发展之道。\"}', 1895724352, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806189146114, 5, '{\"newsTime\":\"09:31\",\"content\":\"【纵横股份发布全新无人值守系统】 5月24日，在第八届世界无人机大会暨2024国际低空经济与无人系统博览会上，纵横股份发布了全新一代纵横昆仑JOS-C800无人值守系统。纵横昆仑JOS-C800无人值守系统是纵横低空数字经济解决方案中的核心部分，基于该系统，可以实现无人机自动巡检、自动充电、异地部署、远程规划指挥、数据自动回传等功能。该系统集成了CW-15V垂直起降固定翼无人机，带载情况下可以实现3小时续航，巡查半径30至50公里，可广泛应用于能源巡检（电力、管线）、矿山、林草、应急、边防、海事、智慧城市等领域。\"}', 282508683, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806222700545, 5, '{\"newsTime\":\"09:20\",\"content\":\"【中国贸促会会长任鸿斌率中国企业家代表团访问英国】 中国贸促会会长任鸿斌率中国企业家代表团访问英国，出席由中国贸促会和英中贸易协会共同主办的第二届中国国际供应链促进博览会路演并致辞，分别会见英工商机构和相关企业主要负责人，介绍中国经济形势以及中国以高质量发展推进中国式现代化、坚持推进高水平对外开放有关情况，积极推动中英工商界在金融、能源、医疗健康、物流等领域合作。\"}', 733986535, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806239477761, 5, '{\"newsTime\":\"09:10\",\"content\":\"【印尼亚齐特别行政区附近海域发生5级地震】 据印尼气象、气候和地球物理局消息，当地时间5月25日7时10分，印尼亚齐特别行政区扎朗镇西南143公里处海域发生5级地震，震中位于北纬3.66度、东经94.73度，震源深度10公里，预计不会有海啸风险。\"}', 1329829024, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806256254977, 5, '{\"newsTime\":\"08:55\",\"content\":\"【中欧班列累计开行突破9万列】 “中国铁路”微信公众号消息，5月25日8时40分，随着X8157次中欧班列（西安—马拉舍维奇）从西安国际港站开出，至此中欧班列累计开行突破9万列，发送货物超870万标箱、货值超3800亿美元，保持安全稳定畅通运行。\"}', 1723944853, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806277226498, 5, '{\"newsTime\":\"08:44\",\"content\":\"【比特币上演“过山车”！全网24小时超11万人爆仓 29亿元蒸发！啥情况？】 北京时间5月24日午后，比特币突然在盘中上演“大跳水”，以太坊、币安币、狗狗币等币种也跟随下挫。\"}', -574744590, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806294003713, 5, '{\"newsTime\":\"08:38\",\"content\":\"【英伟达效应下的“新叙事”？铜互联、玻璃基板之后 GB200或带火这一环节】 “我们已准备好迎接下一波增长。”黄仁勋预计，今年Blackwell架构芯片将带来大量收入。H200和Blackwell架构芯片需求将远远超过供应，英伟达预计这种情况将持续到明年。券商预计，相比DGX系列，GB200单GPU的HDI板价值量将增加244%~476%。\"}', 1658665209, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806314975233, 5, '{\"newsTime\":\"08:36\",\"content\":\"【脑部疾病基因疗法迈出重要一步：新转运载体能有效穿过血脑屏障】 据最新一期《科学》杂志报道，美国麻省理工学院和哈佛大学布罗德研究所团队设计出一种基因转运载体，能利用人类蛋白质有效穿过血脑屏障，并将与疾病相关的基因递送到人源化小鼠的整个大脑中，这是向开发出更有效的脑部疾病基因疗法迈出的重要一步。\"}', -25507482, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806331752449, 5, '{\"newsTime\":\"08:18\",\"content\":\"【美国务卿与以色列战时内阁成员甘茨就加沙局势通话】 根据美国国务院发布的一份声明，美国国务卿布林肯当日与以色列战时内阁成员甘茨进行通话，双方讨论了在加沙实现停火并释放被扣押人员的最新进展。\"}', -1742664942, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806369501185, 5, '{\"newsTime\":\"08:13\",\"content\":\"【中国能建葛洲坝集团与广州工控集团共商合作】 5月24日，中国能建葛洲坝集团党委副书记、总经理、副董事长陈刚赴穗与广州工业投资控股集团有限公司党委书记、董事长景广军座谈，就抢抓粤港澳大湾区市场机遇，积极拓展高端装备、科技研发与转化、产业园区综合开发等领域合作进行深入交流，并达成广泛共识。\"}', -959679098, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806398861313, 5, '{\"newsTime\":\"08:12\",\"content\":\"【高盛将美联储首降窗口推迟至9月！一图纵览华尔街各大行最新预测】 随着本周一连串超预期的美国经济数据表现，令美联储降息预期被泼上了更多冷水；“预测素来多变”的华尔街大行高盛，也忙不迭地将美联储首降窗口推迟至了9月。\"}', 480009437, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806436610049, 5, '{\"newsTime\":\"08:04\",\"content\":\"【为控制禽流感疫情 美对澳部分家禽及副产品实施进口限制】 美国已对来自澳大利亚维多利亚州的部分家禽及其副产品实施进口限制，以控制禽流感疫情。美国农业部动植物卫生检验局当日表示，从5月22日起实施的限制措施将持续到另行通知。美国商务部表示，来自或过境澳大利亚维多利亚州的未加工禽类产品和副产品将不允许进入美国。据悉，澳大利亚本22日报告了首例人类感染禽流感病例，并在一个养鸡场发现了一种具有高度传染性的禽流感病毒株。目前，美国已经确认两起人感染禽流感的病例，美国农业部24日表示在一头奶牛的组织样本中检测到禽流感，并确认美国9个州的58家奶牛场感染禽流感。\"}', -1138248847, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806461775873, 5, '{\"newsTime\":\"07:54\",\"content\":\"【旺季将至 在线旅行平台提前“卡位”各显神通】 端午、暑期临近，各地消费者开始提前筹备夏季出游计划。记者从多家在线旅行平台获悉，端午节假期机票预订量同比大幅提升，县域旅游市场热度延续，赛龙舟民俗游升温。此外，暑期旅游已被不少消费者提上日程，出境游、入境游或迎来小高峰。各地文旅部门、在线旅行平台等主体相互配合，共同创新文旅消费供给、优化文旅服务内容。（中国证券报）\"}', 426895820, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806503718914, 5, '{\"newsTime\":\"07:46\",\"content\":\"【国家发改委：中国与海合会国家达成多项务实成果】 中国—海合会国家产业与投资合作论坛在厦门举办，据国家发展改革委，本届论坛达成多项务实成果。最新数据显示，2023年，中国和海合会国家双边贸易额达2860亿美元，中国继续保持海合会最大贸易伙伴地位。本次论坛推选了47个优秀合作成果案例进行展览展示。进一步激发合作潜力。\"}', 1735137445, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806625353729, 5, '{\"newsTime\":\"07:37\",\"content\":\"【欧尔班：匈牙利不想参与北约在乌军事任务 正重新评估“在北约的角色”】 匈牙利总理欧尔班透露，匈牙利正在重新评估其在北约中的角色，“因为匈牙利并不想参与北约在乌克兰的军事任务”。\"}', -1161189206, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806684073985, 5, '{\"newsTime\":\"07:24\",\"content\":\"【2024年巴西登革热致死病例已达3000例】 根据巴西卫生部当地时间24日公布的最新数据，巴西今年死于登革热的人数已达3000人。数据显示，目前巴西登革热感染病例已经超过500万例，另有2666个疑似登革热死亡病例等待确认死因。\"}', 1344476913, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806814097410, 5, '{\"newsTime\":\"07:21\",\"content\":\"【风险警示股票突破180家 机构资金主动撤离】 A股风险警示股票的扩容速度进入峰值。截至5月24日，市场ST和*ST公司数量突破180家。尤其5月以来，被ST或*ST的上市公司数量加速扩容，仅5月6日至5月21日短短16天内，即有54家上市公司被“披星戴帽”——27家由未被实施任何风险警示到被ST、8家由ST调整为*ST、19家由无风险警示一步恶化为*ST。\"}', 582675768, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806877011970, 5, '{\"newsTime\":\"07:01\",\"content\":\"【推动医学科技与产业创新融合】 健康是重要的民生福祉，保障人民健康是现代国家的重要职责。新时代以来，我国医学科技创新持续提速，一大批面向人民生命健康的创新成果得以转化和应用。迈上新征程，要进一步坚持科技创新，加大医学科技攻关力度，使之更好地增进人民健康福祉。\"}', -1445039280, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213806977675266, 5, '{\"newsTime\":\"06:56\",\"content\":\"【抢抓新风口 面板厂商角逐中尺寸OLED市场】 5月以来，苹果、华为纷纷推出新款OLED平板电脑。中国证券报记者调研了解到，由于成本高，目前OLED平板电脑售价较贵。但业内人士认为，苹果、华为等厂商在平板电脑上使用OLED显示屏，标志着头部厂商在平板电脑中显示技术偏好转变，OLED屏成为平板电脑行业新风向，或将带动其他厂商陆续量产OLED产品。\"}', -997333485, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213807019618306, 5, '{\"newsTime\":\"06:51\",\"content\":\"【美国多家电力公司要求法院停止执行拜登的污染限制措施】 美国多家电力公用事业公司要求华盛顿联邦上诉法院立即停止执行拜登政府对发电厂的温室气体排放限制。他们认为，如果不暂停，该规定将迫使公用事业公司立即将资金转移到增加工厂的碳控制或投资新的天然气发电上，而牺牲更清洁的电力来源。\"}', 11716527, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213807103504385, 5, '{\"newsTime\":\"06:46\",\"content\":\"【机构密集调研券商 关注并购重组计划】 5月以来，多家券商获机构密集调研。从调研频次来看，被调研次数较多的券商有申万宏源、国信证券、红塔证券等。在投资者提问中，“并购重组”出现频率最高。多家券商被提问是否有合并重组计划或主要股东变更情况等。“监管层对于行业兼并重组的表态比较明确，这为券商并购提供了有力的政策支持。新一轮行业并购浪潮下，蕴含并购重组预期的标的数量有望增加，将进一步促进资源优化配置，推动行业集约化发展。”一位券商人士表示。\"}', 1744648524, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213807237722113, 5, '{\"newsTime\":\"06:45\",\"content\":\"【水泥新国标实施在即 行业加速优胜劣汰】 6月1日，工业和信息化部组织制定的GB 175-2023《通用硅酸盐水泥》强制性国家标准（以下简称“水泥新国标”）将正式实施。这是我国对通用硅酸盐水泥标准进行的第七次修订。\"}', 420193902, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213807275470849, 5, '{\"newsTime\":\"06:33\",\"content\":\"【85只公募基金月内收益率超5% 白银等主题产品表现佳】 5月份以来，贵金属、铜等龙头大宗商品迎来一轮强势上行行情，其中，部分品种更是创出阶段性新高。与此同时，包括商品型、偏股混合型、QDII（合格境内机构投资者）偏股混合型等基金的净值也同步出现明显走高态势。\"}', -371849346, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213807342579713, 5, '{\"newsTime\":\"06:29\",\"content\":\"【年内256份年报问询函多维度“拷问”上市公司】 虽然年报披露已经结束，但监管层对上市公司关于年报的问询仍在继续。据《证券日报》记者统计，截至5月24日，沪深北交易所年内已发布256份年报问询函，其中，5月份以来的问询函数量超过212份。\"}', 1414978846, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213807480991745, 5, '{\"newsTime\":\"06:22\",\"content\":\"【“人工智能+音乐”奏响新乐章】 人工智能技术加速与音乐内容创作、规模化自动化生产、消费场景打造等维度融合，对音乐的创作、生产、传播与消费产生积极影响，助推我国文化强国建设。\"}', 2082102530, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213807514546177, 5, '{\"newsTime\":\"06:10\",\"content\":\"【广西防城港核电站“华龙一号”4号机组今天投产发电】 来自中国广核集团的消息，今天（25日），广西防城港核电站“华龙一号”4号机组完成试运行，正式投产发电。广西防城港核电站4号机组和3号机组均采用我国自主三代核电技术“华龙一号”，两台机组年发电量可达180亿千瓦时，能够满足200万人口的生产生活年度用电需求，每年可减少标煤消耗超543.6万吨，减少二氧化碳排放约1483.2万吨，环保效益相当于植树造林超4万公顷，对促进广西能源绿色转型、保障能源安全供应、提升能源系统效率等具有重要意义。\"}', 1115642091, '证券快讯', '2024-05-25 11:48:01');
