INSERT INTO `reptile_data` VALUES (1794213807594237954, 5, '{\"newsTime\":\"05:55\",\"content\":\"【渤海证券突遭立案 IPO进程再添变数】 日前，渤海证券股份有限公司（以下简称“渤海证券”）公告称收到中国证券监督管理委员会（以下简称“证监会”）《立案告知书》。因涉嫌财务顾问业务违法违规，根据相关法律法规，证监会决定对渤海证券立案。\"}', 103808333, '证券快讯', '2024-05-25 11:48:01');
INSERT INTO `reptile_data` VALUES (1794213807640375298, 5, '{\"newsTime\":\"05:45\",\"content\":\"【谷歌AI搜索综述因“低级错误”引爆互联网吐槽】 谷歌在上周开发者大会上重点强调的“AI概览”（AI Overviews）功能近日在美国市场上线。但由于这个功能频频向用户提供一些荒谬的回答，例如“往披萨里加胶水”、“每天至少要吃1块石头”，引发美国网民集体嘲讽。谷歌回应称，错误往往来自于“非常罕见的查询”，将根据这些“孤例”进行改进。\"}', 1859208913, '证券快讯', '2024-05-25 11:48:01');
